api_list.description:
- Remote access server settings. If enabled - panel sends proper request to remote server and |
wait for response. If server desn't responde during timeout panels takes access control |
itself.
- Device sends post request with application/json body:
```
{
  "identifier_number": "5a4sd7a5s4d5as3d54asd",
  "identifier_type": "card"
}
```
identifier_type can have to types: 'card' and 'input_code'
- Device waits for response with next application/json bodies:
1. Access not handled. Panel should handle access itself:
```
{
	"handled": false
}
```
2. Access not granted:
```
{
	"handled": true,
	"access": {
		"granted": false
	}
}
```
3. Access granted, open first lock:
```
{
	"handled": true,
	"access": {
		"granted": true,
		"lock_number": 1
	}
}
```
- where 'lock_number' (lock to open) may take next values: 0 - both locks, 1 - first lock, 2 -second lock
- also, you can use apropriate device api call to open specific lock

